import React from "react";

const Benefit = () => {
  return (
    <div style={{ marginLeft: "20px", border: "3px solid black", width270px }}>
      <p style={{ marginLeft: "10px", fontWeight: "bold" }}>
        Yang anda dapatkan di pelatihan ini :
      </p>
      <ul>
        <li style={{ marginLeft: "10px", marginTop: "-10px" }}>
          4 menit total video pembelajaran
        </li>
      </ul>
    </div>
  );
};

export default Benefit;
